// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract Staking {
    address public owner;

    struct Position {
        uint256 positionId;
        address walletAddress;
        uint256 createdDate;
        uint256 unlockDate;
        uint256 percentInterest;
        uint256 weiStaked;
        uint256 weiInterest;
        bool open;
    }

    Position position;

    uint256 public currentPositionId;
    mapping(uint256 => Position) public positions;
    mapping(address => uint256[]) public positionsIdsByAddress;
    mapping(uint256 => uint256) public tiers;
    uint256[] public lockPeriods;

    constructor() payable {
        owner = msg.sender;
        currentPositionId = 0;

        tiers[7] = 700;
        tiers[14] = 1000;
        tiers[30] = 1200;

        lockPeriods.push(7);
        lockPeriods.push(14);
        lockPeriods.push(30);
    }

    function stakeEther(uint256 numDays) external payable {
        require(tiers[numDays] > 0, "Invalid lock period");

        positions[currentPositionId] = Position(
            currentPositionId,
            msg.sender,
            block.timestamp,
            block.timestamp + numDays * 1 days,
            tiers[numDays],
            msg.value,
            calculateInterest(tiers[numDays], numDays, msg.value),
            true
        );

        positionsIdsByAddress[msg.sender].push(currentPositionId);
        currentPositionId += 1;
    }

    function calculateInterest(
        uint256 basisPoints,
        uint256 numDays,
        uint256 weiAmmount
    ) private pure returns (uint256) {
        return (basisPoints * numDays * weiAmmount) / 10000;
    }

    function modifyLockPeriods(uint256 numDays, uint256 basisPoints) external {
        require(owner == msg.sender, "Only owner can modify lock periods");

        tiers[numDays] = basisPoints;
        lockPeriods.push(numDays);
    }

    function getLockPeriods() external view returns (uint256[] memory) {
        return lockPeriods;
    }

    function getInterestRate(uint256 numDays) external view returns (uint256) {
        return tiers[numDays];
    }

    function getPositionById(uint256 positionId)
        external
        view
        returns (Position memory)
    {
        return positions[positionId];
    }

    function getPositionIdsForAddress(address walletAddress)
        external
        view
        returns (uint256[] memory)
    {
        return positionsIdsByAddress[walletAddress];
    }

    function changeUnlockDate(uint256 positionId, uint256 newUnlockDate)
        external
    {
        require(owner == msg.sender, "Only owner can modify lock periods");

        positions[positionId].unlockDate = newUnlockDate;
    }

    function closePosition(uint256 positionId) external {
        require(
            positions[positionId].walletAddress == msg.sender,
            "Only owner can close position"
        );
        require(positions[positionId].open, "Position is already closed");

        positions[positionId].open = false;

        if (block.timestamp > positions[positionId].unlockDate) {
            uint256 amount = positions[positionId].weiStaked +
                positions[positionId].weiInterest;
            payable(msg.sender).transfer(amount);
            // payable(msg.sender).call{value: amount}("");
        } else {
            payable(msg.sender).transfer(positions[positionId].weiStaked);
            // payable(msg.sender).call{value: positions[positionId].weiStaked}(
            //     ""
            // );
        }
    }
}

